import React from "react";
import classNames from "classnames/bind";
import style from "./Header.module.scss";

import { faCaretDown } from "@fortawesome/free-solid-svg-icons";

import logo from "../../../assets/img/logo.svg";
import DropdownMenu from "../../DropdownMenu";
import HeaderLeft from "./HeaderLeft";
import HeaderRight from "./HeaderRight";

let cx = classNames.bind(style);

export default function Header() {
  const dropdownList = [
    {
      content: "Home",
      path: "#",
      icon: faCaretDown,
      children: [
        {
          path: "",
          content: "Crossfit",
        },
        {
          path: "",
          content: "Fitness",
        },
        {
          path: "",
          content: "Crossfit Lite",
        },
      ],
    },
    {
      content: "About",
      path: "",
      icon: null,
      children: [],
    },
    { content: "Service", path: "", icon: null, children: [] },
    {
      content: "Pages",
      path: "#",
      icon: faCaretDown,
      children: [
        {
          path: "",
          content: "Program",
        },
        {
          path: "",
          content: "Trainer",
        },
      ],
    },
    { content: "News", path: "", icon: null, children: [] },
    { content: "Contacts", path: "", icon: null, children: [] },
  ];
  return (
    <header className={cx("header")}>
      <a href="#" classNames={cx("nav-btn")}>
        <span></span>
        <span></span>
        <span></span>
      </a>
      <div className={cx("top-panel")}>
        <div className={cx("container1", { container: true })}>
          <HeaderLeft />
          <HeaderRight />
        </div>
      </div>
      <div class="header-menu">
        <div class="container">
          <div class="header-logo">
            <a href="index-2.html" class="logo">
              <img src={logo} alt="logo" />
            </a>
          </div>
          <DropdownMenu data={dropdownList} />
        </div>
      </div>
    </header>
  );
}
